import React from 'react'

const RemovableTag = props => {

    let content = (
        <div className={props.className}>
            <div className="h-6 w-auto p-2 bg-gray-900 rounded flex">
                <h4 className="font-sans font-medium text-xw-100 leading-tight">
                    {props.category.name}
                </h4>
            </div>
        </div>
    )

    return content
}

export default RemovableTag
